import React, { useState, useEffect } from 'react';
import { TextField, Box, Button, Typography, Paper } from '@material-ui/core';
import FireBase from 'react-file-base64';
import { useDispatch, useSelector } from 'react-redux';
import DoneOutlineIcon from '@mui/icons-material/DoneOutline';
import useStyles from './styles';
import { createMeal,updateMeal } from '../../actions/menu';

// GET THE CURRENT ID

const curMeals = [
    {
      value: 'Pasta',
      label: 'Pasta',
    },
    {
      value: 'Pizza',
      label: 'Pizza',
    },
    {
      value: 'Burger',
      label: 'Burger',
    },
    {
      value: 'Salad',
      label: 'Salad',
    },
  ];

const TableCreate = () => {
    const [curMeal, setCurMeal] = React.useState('EUR');

    const handleChange = (event) => {
        setCurMeal(event.target.value);
    };
    return (

        <Box component="form" 
             sx={{ '& .MuiTextField-root': { m: 1, width: '25ch' },}}
             noValidate autoComplete="off">
            <Paper>
            <div>
                <TextField
                    id="filled-select-currency-native"
                    select
                    label="Native select"
                    value={curMeal}
                    onChange={handleChange}
                    SelectProps={{
                        native: true,
                    }}
                    helperText="Please select your currency"
                    variant="filled"
                    >
                    {curMeals.map((option) => (
                        <option key={option.value} value={option.value}>
                        {option.label}
                        </option>
                    ))}
                </TextField>
                <TextField
                id="standard-read-only-input"
                label="Table ID"
                defaultValue="Hello World"
                InputProps={{
                    readOnly: true,
                }}
                variant="standard"
                />
                <TextField
                id="standard-number"
                label="Amount"
                type="number"
                InputLabelProps={{
                    shrink: true,
                }}
                variant="standard"
                />
                <TextField
                id="standard-number"
                label="Price"
                type="number"
                InputLabelProps={{
                    shrink: true,
                }}
                variant="standard"
                />
                <Button variant="outlined" startIcon={<DoneOutlineIcon />} >
                    Done
                </Button>
            </div>
            </Paper>
        </Box>
    );
}

export default TableCreate;
